import React from 'react'
import {AiOutlineGlobal } from 'react-icons'

function Navbar() {
    const nav = [
        {
            "title":"Syndico",
            "link":""
        },
        {
            "title":"Module",
            "link":""
        },
        {
            "title":"Contact",
            "link":""
        },
    ]
  return (
    <div className='navbar'>
        <logo>
            <img src="/images/syndico.png" />
        </logo>
        <ul>
            {nav.map((item,key)=>(
                <li key={key+1}> <h3> {item.title} </h3> </li>
            ))}
            <li> <AiOutlineGlobal />  </li>
        </ul>
    </div>
  )
}

export default Navbar
